import{_ as e,c as a,o as t,a5 as l}from"./chunks/framework.-i2sbza6.js";const g=JSON.parse('{"title":"NP Damage Ranking","description":"","frontmatter":{},"headers":[],"relativePath":"laplace/np_dmg_ranking.md","filePath":"laplace/np_dmg_ranking.md","lastUpdated":1691155607000}'),i={name:"laplace/np_dmg_ranking.md"},n=l('<h1 id="np-damage-ranking" tabindex="-1">NP Damage Ranking <a class="header-anchor" href="#np-damage-ranking" aria-label="Permalink to &quot;NP Damage Ranking&quot;">​</a></h1><h3 id="select-targets" tabindex="-1">Select Targets <a class="header-anchor" href="#select-targets" aria-label="Permalink to &quot;Select Targets&quot;">​</a></h3><ul><li><strong>(Recommended)</strong> In any quest detail page, click on enemy icon then select NP Damage from the top right menu to set it as the target</li><li>Edit dummy target directly <ul><li>Needs decent knowledge of FGO data structure, mainly traits &amp; supereffective damage</li></ul></li></ul><h3 id="options" tabindex="-1">Options <a class="header-anchor" href="#options" aria-label="Permalink to &quot;Options&quot;">​</a></h3><ul><li>Support Servant: Skill levels are set to 10/10/10, does not use NP, and will be removed from team once done casting skills</li><li>Game Server: Determines strengthen status</li><li>Player Data: Whether to use data from current plan to setup servants</li><li>Fixed OC: Disables OC related buffs, use the set value as OC value</li><li>Twice Skills: Current logic is to cast all skills in one turn, so some 1T buff will be counted twice</li><li>Debuff Immune: Since some servants have skills that stun themselves (Lip), this option needs to be enabled for those servants to attack properly <ul><li>Also, since Supports will be removed once skills are cast, Caren&#39;s Passive will not activate</li></ul></li><li>Force Enable NP S.E.: Only force enable for NP, will not force enable buff related ones</li><li>Some Other Notes: <ul><li>Kukulkan will always use the skill option to consume Critical Stars (even if there&#39;s not enough to consume)</li><li>Space Ishtar, Emiya will have each of their NP type ranked separately</li><li>Melusine has three forms: ST Arts NP without using skill 3, starts with ST Arts NP then uses skill 3 to transform to AOE Buster NP, and starts with AOE Buster NP directly. These three are also ranked separately</li></ul></li></ul><h3 id="ranking" tabindex="-1">Ranking <a class="header-anchor" href="#ranking" aria-label="Permalink to &quot;Ranking&quot;">​</a></h3><p>Click on each lane to check parameters</p><ul><li>Click on the icon in the top right corner for filtering</li><li>After checking parameters, can click Details to view actions performed</li><li>NP Gain arrow means there are NP gained not from the NP damage itself. E.g. Space Ishtar</li><li>Succeeded Instant Death NP will have higher priority in ranking</li></ul>',8),r=[n];function s(o,c,h,d,u,m){return t(),a("div",null,r)}const k=e(i,[["render",s]]);export{g as __pageData,k as default};
